import React from 'react';
import MainPage from './Components/MainPage/MainPage';
import Exercise from './Classes/Execirse';
import CssSelectorExercise from './Classes/CSSExercise';

function App() {

  const excersises = [];

  for (let index = 0; index <= 32; index++) {
    if (index % 5 == 0) {
      excersises.push(new CssSelectorExercise(`${index}`, true,"The Universal Selector",))
    }
    else {
      excersises.push(new Exercise(`${index}`, false))
    }

  }
  return (
    <MainPage excersises={excersises} />
  );
}

export default App;
